// src/pages/ContactUs.js
import React from 'react';
import './ContactUs.css'; // Create this file for styling

const ContactUs = () => {
  const developers = [
    { name: 'Alice Johnson', email: 'alice.johnson@example.com', phone: '+1234567890' },
    { name: 'Bob Smith', email: 'bob.smith@example.com', phone: '+0987654321' }
  ];

  return (
    <div className="contact-us">
      <h1>Contact Us</h1>
      <div className="contact-details">
        <h2>Contact Information:</h2>
        <p>If you have any questions, please feel free to contact us at:</p>
        <p>Email: support@example.com</p>
        <p>Phone: +1234567890</p>

        <h2>Meet Our Developers:</h2>
        <ul>
          {developers.map((developer, index) => (
            <li key={index} className="developer">
              <h3>{developer.name}</h3>
              <p>Email: <a href={`mailto:${developer.email}`}>{developer.email}</a></p>
              <p>Phone: <a href={`tel:${developer.phone}`}>{developer.phone}</a></p>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default ContactUs;
